import React, { Fragment, useEffect, useState } from "react";
import { getProduct } from "../../services/products";
import { Button, Card, CardContent, Typography } from '@mui/material';
const Product = () => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    fetchData();
    return () => null;
    // eslint-disable-next-line
  }, []);

let product_id
let price
let category
let availability_status

  const fetchData = async () => {
    const data = await getProduct({
      product_id,
      price,
      category,
      availability_status,
    });

    setProducts(data?.message?.items_list);
    console.log("XXXXXXXXXXXXXXXXXx",data);
    
  };
  console.log("products", products);

  return (
    <Fragment>
        {/* <Card> */}
        {/* <CardContent> */}
        {products?.length === 0 ? (
            <div>
                no result
            </div>
        )
        :
        (
            products.map((item)=>
            <Card>

            <CardContent>
            <Typography variant="h5" component="div">{item.name}</Typography>
            <div>{item.category}</div>
            <div>{item.description}</div>
            <div>{item.price}</div>
            <div>{item.availability_status}</div>
            
            </CardContent>
            </Card>

            ))}
        )}
        {/* </CardContent> */}
        {/* </Card> */}
        <Button></Button>
      <h1>Product</h1>
    </Fragment>
  );
};

export default Product;
